import { Button } from 'antd';


function App() {
  return (
    <div className="bg-primary h-screen ">
      <div className="bg-white items-center p-1">
      <h1>
        Shopping list - Home
      </h1>

      <div><Button type="primary" >Home</Button>
      <Button type="primary">Preview List</Button>
      <Button type="primary">Created Lists</Button></div>

      </div>
     </div> 

  );
}

export default App;
